import './intro.css';
import bg from './bg.png';

const Intro =() => {
    return(
        <section id="intro" >
            <div>
                <h3>Hello</h3>
                <h2>I'm </h2> <h1>Umamaheswari Tamilselvan</h1> 
                <h2>I'm a FrontEnd developer! </h2>
            </div>
            <img src={bg} alt="ProfilePic" className="bg" />
        </section>
    );
}

export default Intro;
